    false,nt"url": null,nt"notes": "This report summarizes the activities of
    the student assistant at Malheur National Wildlife Refuge during the summer of 1952.
    This report covers field work conducted on the waterfowl nesting-grazing study and
    other problems at Malheur Refuge from June 16, 1952 to September 16, 1952. Its main
    purpose has been to contribute information toward a better understanding of the
    effect of grazing on waterfowl production, primarily by its influence on nesting
    cover. Discussed in the text are general considerations of meteorological and water
    conditions of 1952 in Harney basin, nesting pair census, nest searching techniques,
    nesting results, brood census, banding, disease, and predation.",nt"license_title":
